import React, { useState } from "react";
import "./HomePage.css";

const HomePage = () => {
  return (
    <div className="home-page">
      <img
        src="https://media.npr.org/assets/img/2021/02/19/scott_kobner03_wide-fd05f3d15fbb710e3b0d1f63940134616c2987a6.jpg?s=1400&c=100&f=jpeg"
        alt="Imagem de Fundo"
        className="background-image-hp"
      />
    </div>
  );
};

export default HomePage;
